import React from 'react';
import FirstSection from './Home/First/FirstSection';
import SecondSection from './Home/Second/SecondSection';
import ThirdSection from './Home/Third/ThirdSection';
import FourthSection from './Home/Fourth/FourthSection';

function Home() {
  return (
    <div>
      <FirstSection/>
      <SecondSection/>
      <ThirdSection/>
      <FourthSection/>
    </div>
  );
}

export default Home;
